    "title": "PGFPlotsX",
    "category": "section",
    "text": "Documentation Build Status\n[![][docs-stable-img]][docs-stable-url] [![][docs-latest-img]][docs-latest-url] [![][travis-img]][travis-url] (Image: codecov)PGFPlotsX is a Julia package to generate publication quality figures using the LaTeX library PGFPlots.It is similar in spirit to the package PGFPlots.jl but it tries to have a very close mapping to the PGFPlots API as well as minimize the number of dependencies. The fact that the syntax is similar to the TeX version means that examples from Stack Overflow and the PGFPlots manual can easily be incorporated in the Julia code.Features include:Showing figures inline in Jupyter notebooks, Juno and VSCode-julia. Both png- and svg-figures can be shown.\nExporting to tex, pdf, svg, and png, file formats.\nCustomizing the preamble so that commands from latex packages can be used.\nExtra functionality when different packages are loaded, for example Colors, DataFrames, Contour etc."
